    false,nt"url": null,nt"notes": "Zooplankton data are abundance by taxanomic
    group (to species where possible), stage, size and sex. Zooplankton sorting is performed
    at The Polish Plankton Sorting Institute in Szcecin, Poland. The zooplankton protocol
    was changed in 2012 to include a wider range of taxaonomic categories for all study
    areas and to finer taxanomic resolution where possible. Limited biomass information
    is available using literature values for micrograms carbon of select copepod species.
    Various gears with different mesh sizes are used to asses different size classes
    of zooplankton including 20/60cm paired bongos, Tucker, Multinet, MOCNESS, Methot,
    CalVET and microzooplankton nets hung on nisken bottles.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
